import React from 'react'
import Card from './Card.js'
import image1 from '../assets/IslaPelicanoH.jpeg';
import image2 from '../assets/NacarHotelCartagena.jpeg';
import image3 from '../assets/imgGraHya.jpeg';

const cards = [
    {
        id: 1,
        title: 'App from con react',
        image: image1
    },
    {
        id: 2,
        title: 'App from con react',
        image: image2
    },
    {
        id: 3,
        title: 'App from con react',
        image: image3
    }
]

function Cards() {
    return (
        <div className='container d-flex justify-content-center align-items-center h-100'>
            <div className='row'>
                {
                    cards.map( card => (
                        <div className="col-md-4" key={card.id} >
                            <Card key={card.title} imageSource={card.image}/>
                        </div>  
                    ))
                }
            </div>
        </div>
    )
}

export default Cards
